import React from 'react';
import { TrendingUp, FileText, DollarSign, Users } from 'lucide-react';

const Dashboard: React.FC = () => {
  const stats = [
    {
      title: 'Total Menus',
      value: '12',
      icon: FileText,
      color: 'text-accent-cyan',
      bgColor: 'bg-accent-cyan/10',
    },
    {
      title: 'Revenue',
      value: '$24,500',
      icon: DollarSign,
      color: 'text-green-400',
      bgColor: 'bg-green-400/10',
    },
    {
      title: 'Growth',
      value: '+15%',
      icon: TrendingUp,
      color: 'text-accent-blue',
      bgColor: 'bg-accent-blue/10',
    },
    {
      title: 'Active Users',
      value: '1,234',
      icon: Users,
      color: 'text-purple-400',
      bgColor: 'bg-purple-400/10',
    },
  ];

  return (
    <div className="p-6">
      <div className="mb-8">
        <h1 className="text-3xl font-bold text-white mb-2">Welcome back, John!</h1>
        <p className="text-gray-400">Here's what's happening with your menus today.</p>
      </div>

      {/* Stats Grid */}
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6 mb-8">
        {stats.map((stat, index) => {
          const Icon = stat.icon;
          return (
            <div key={index} className="bg-gray-800 rounded-lg p-6 border border-gray-700">
              <div className="flex items-center justify-between">
                <div>
                  <p className="text-gray-400 text-sm font-medium">{stat.title}</p>
                  <p className="text-2xl font-bold text-white mt-1">{stat.value}</p>
                </div>
                <div className={`p-3 rounded-lg ${stat.bgColor}`}>
                  <Icon className={`w-6 h-6 ${stat.color}`} />
                </div>
              </div>
            </div>
          );
        })}
      </div>

      {/* Recent Activity */}
      <div className="bg-gray-800 rounded-lg border border-gray-700 p-6">
        <h2 className="text-xl font-semibold text-white mb-4">Recent Activity</h2>
        <div className="space-y-4">
          <div className="flex items-center space-x-4 p-4 bg-gray-700 rounded-lg">
            <div className="w-2 h-2 bg-accent-cyan rounded-full"></div>
            <div className="flex-1">
              <p className="text-white font-medium">New menu uploaded</p>
              <p className="text-gray-400 text-sm">Summer Menu 2024</p>
            </div>
            <span className="text-gray-400 text-sm">2 hours ago</span>
          </div>
          
          <div className="flex items-center space-x-4 p-4 bg-gray-700 rounded-lg">
            <div className="w-2 h-2 bg-accent-blue rounded-full"></div>
            <div className="flex-1">
              <p className="text-white font-medium">Menu optimization completed</p>
              <p className="text-gray-400 text-sm">Spring Menu 2024</p>
            </div>
            <span className="text-gray-400 text-sm">1 day ago</span>
          </div>
          
          <div className="flex items-center space-x-4 p-4 bg-gray-700 rounded-lg">
            <div className="w-2 h-2 bg-green-400 rounded-full"></div>
            <div className="flex-1">
              <p className="text-white font-medium">Revenue increased</p>
              <p className="text-gray-400 text-sm">+12% from last month</p>
            </div>
            <span className="text-gray-400 text-sm">3 days ago</span>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
